            <div className='carWreckImage'>
                <img alt="car wreck" src={require('../media/policeWreck.jpeg')} className="m-5" />
            </div>
            <div>
                <h6>Sorry! Unfortunately, this page cannot be reached.</h6>
            </div>
        </div>
    )
}
export default ErrorPage
